<?phpnamespace Nemundo\WebLog\Data\Domain;class DomainModel extends \Nemundo\Model\Definition\Model\AbstractModel {/*** @var \Nemundo\Model\Type\Id\IdType*/public $id;/*** @var \Nemundo\Model\Type\Text\TextType*/public $domain;protected function loadModel() {$this->tableName = "weblog_domain";$this->aliasTableName = "weblog_domain";$this->label = "Domain";$this->primaryIndex = new \Nemundo\Db\Index\AutoIncrementIdPrimaryIndex();$this->id = new \Nemundo\Model\Type\Id\IdType($this);$this->id->tableName = "weblog_domain";$this->id->externalTableName = "weblog_domain";$this->id->fieldName = "id";$this->id->aliasFieldName = "weblog_domain_id";$this->id->label = "Id";$this->id->allowNullValue = false;$this->domain = new \Nemundo\Model\Type\Text\TextType($this);$this->domain->tableName = "weblog_domain";$this->domain->externalTableName = "weblog_domain";$this->domain->fieldName = "domain";$this->domain->aliasFieldName = "weblog_domain_domain";$this->domain->label = "Domain";$this->domain->allowNullValue = false;$this->domain->length = 100;$index = new \Nemundo\Model\Definition\Index\ModelUniqueIndex($this);$index->indexName = "domain";$index->addType($this->domain);}}